import Nav from "../src/components/Nav";
import Hero from "./components/Hero";

function App() {
	return (
		<div className="flex items-center flex-col mt-[5%]">
			<div className="bg-white w-[80%] h-[85%] rounded-xl">
				<Nav />
				<Hero />
			</div>
		</div>
	);
}

export default App;
